"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Threatened miscarriage (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/threatened-miscarriage-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H206647614\">",
"      <span class=\"h1\">",
"       What is a miscarriage?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A miscarriage is when a pregnancy ends before a woman has been pregnant for 20 weeks. (A normal pregnancy lasts about 40 weeks.) The most common symptoms of a miscarriage are bleeding from the vagina and belly pain or cramping.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H206647621\">",
"      <span class=\"h1\">",
"       What is a threatened miscarriage?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A threatened miscarriage is when a woman has bleeding from the vagina, but her pregnancy has not actually ended. The medical term for a threatened miscarriage is a &ldquo;threatened spontaneous abortion.&rdquo;",
"     </p>",
"     <p>",
"      In a threatened miscarriage, 1 of 2 things can happen. Most of the time, the bleeding will stop on its own and the pregnancy will continue normally. But sometimes, a threatened miscarriage will become a miscarriage.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H206647628\">",
"      <span class=\"h1\">",
"       Did I do anything to cause my threatened miscarriage?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You probably did not do anything to cause your threatened miscarriage. And if your threatened miscarriage becomes a miscarriage, it is also probably not because of anything you did.",
"     </p>",
"     <p>",
"      Most of the time, a miscarriage happens when a pregnancy does not grow normally from the beginning.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H206647635\">",
"      <span class=\"h1\">",
"       What are the symptoms of a threatened miscarriage?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Women with a threatened miscarriage have bleeding from the vagina. Some women also have pain in their belly, but most women don&rsquo;t.",
"     </p>",
"     <p>",
"      There are other conditions that can cause bleeding from the vagina during the first half of pregnancy. But the most common causes have to do with miscarriage.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H206647642\">",
"      <span class=\"h1\">",
"       Should I call my doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you are pregnant and have bleeding from your vagina, call your doctor or nurse right away. Bleeding during pregnancy can sometimes be a symptom of an emergency condition.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H206647649\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will ask about your symptoms and do an exam. He or she will check for your baby&rsquo;s heartbeat. There are 2 main ways doctors can do this. They can use:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A device called a &ldquo;fetal Doppler monitor&rdquo; &ndash; The doctor puts this device on your belly. It uses sound waves to let you hear your baby&rsquo;s heartbeat.",
"       </li>",
"       <li>",
"        An imaging test called an ultrasound &ndash; An ultrasound uses sound waves to create pictures of the inside of your body and of your baby. This test can show pictures of your baby&rsquo;s heartbeat.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Your doctor will probably also do a test to measure the amount of &ldquo;hCG&rdquo; (a pregnancy hormone) in your blood. You might need to have this test again a few days later.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H206647656\">",
"      <span class=\"h1\">",
"       How is a threatened miscarriage treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Unfortunately, there are not many reliable treatments for a threatened miscarriage. Doctors can use a medicine called progesterone to try to prevent a miscarriage in women who have vaginal bleeding, but this medicine doesn&rsquo;t always work.",
"     </p>",
"     <p>",
"      Sometimes, doctors recommend that women with vaginal bleeding lie in bed or avoid having sex, but these treatments have not been shown to help prevent a miscarriage either.",
"     </p>",
"     <p>",
"      If you have bleeding from your vagina, your doctor will follow your symptoms until:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Your bleeding stops, and he or she has made sure that your pregnancy is growing normally.",
"       </li>",
"       <li>",
"        You have a miscarriage. If this happens, your doctor will talk with you about what to do next.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H206647712\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?16/52/17218?source=see_link\">",
"       Patient information: Miscarriage (The Basics)",
"      </a>",
"      <br/>",
