"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?28/8/28803?source=see_link\">",
"       Patient information: Miscarriage (Beyond the Basics)",
"      </a>",
"     </p>",
